// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Counter {

    address owner;
    address factory;
    uint count;

    modifier factoryOnly() {
        require(msg.sender == owner);
        _;
    }

    constructor(address address_)
    {
        owner = address_;
        factory = msg.sender;
    }

    function getCount()
        public
        view
        returns(uint)
    {
        return count;
    }

    function incrementCount()
        public
    {
        count++;
    }

}

